import React from 'react';
import { NavLink } from 'react-router-dom';
import { request, setAuthHeader } from '../axios_helper';

function logout() {
  setAuthHeader(null);
};

export function onLogin(e, email, password) {
  e.preventDefault();
  request(
    "POST",
    "/login",
    {
      email: email,
      password: password
    }).then(
      (response) => {
        setAuthHeader(response.data.token);
      }).catch(
        (error) => {
          setAuthHeader(null);
        }
      );
};

export function onRegister(event, surname, firstname, patronymic, email, password) {
  event.preventDefault();
  request(
    "POST",
    "/register",
    {
      surname: surname,
      firstname: firstname,
      patronymic: patronymic,
      email: email,
      password: password
    }).then(
      (response) => {
        setAuthHeader(response.data.token);
      }).catch(
        (error) => {
          setAuthHeader(null);
        }
      );
};


export const Navbar = ({ isAuthenticated, handleLogout }) => {
  return (
    <>
      <nav className="bg-white border-gray-200">
        <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto bg-blue-600">
          <a href="/" className="flex items-center">
            <span className="self-center text-2xl font-semibold whitespace-nowrap">Cleaning service</span>
          </a>
          <div className="hidden w-full md:block md:w-auto" id="navbar-default">
            <ul className="font-medium flex flex-col p-4 md:p-0 mt-4 md:flex-row md:space-x-8 md:mt-0">
              <li>
                <NavLink
                  to="/"
                  className="block py-2 pl-3 p-4 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                >
                  Главная
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/contacts"
                  className="block py-2 pl-3 pr-4 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                >
                  Контакты
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/services"
                  className="block py-2 pl-3 pr-4 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                >
                  Услуги
                </NavLink>
              </li>
              {isAuthenticated ? (
                <>
                  <li>
                    <NavLink
                      to="/myapps"
                      className="block py-2 pl-3 pr-4 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                    >
                      Личный кабинет
                    </NavLink>
                  </li>
                  <li>
                    <NavLink
                      to="/cart"
                      className="block py-2 pl-3 pr-4 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                    >
                      Корзина
                    </NavLink>
                  </li>
                  <li>
                    <button
                      onClick={() => {
                        handleLogout();
                        logout();
                      }}
                      className="block py-2 pl-3 pr-4 ml-16 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                    >
                      Выйти
                    </button>
                  </li>
                </>
              ) : (
                <li>
                  <NavLink
                    to="/login"
                    className="block py-2 pl-3 pr-4 ml-16 text-white rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0"
                  >
                    Войти
                  </NavLink>
                </li>
              )}
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
};
